int Choose(int n, int m)
{
	int top = n;
	int BL = m;
	int BR = n - m;

	int newtop = 1;
	int newBL = 1;
	int newBR = 1;

	while (top > 1)
	{
		newtop = top * newtop;
		top--;
	}

	while (BL > 1)
	{
		newBL = BL * newBL;
		BL--;
	}

	while (BR > 1)
	{
		newBR = BR * newBR;
		BR--;
	}

	int final;

	final = newtop / (newBL * newBR);

	return final;

}

