    int fact1;
    int fact2;
    int fact3;

    int p = n - m;

    for(int i = 1; i < n; i++) {
        fact1 = fact1 * i;
    }
    for(int i = 1; i < m; i++) {
        fact2 = fact2 * i;
    }
    for(int i = 1; i < p; i++) {
        fact3 = fact3 * i;
    }
    
    
    return (fact1/(fact2*((n-m)*fact3)));
}

