// Function to calculate n choose m recursively
int Choose(int n, int m) {
    // Base cases
    if (m == 0 || m == n) {
        return 1;  // C(n, 0) and C(n, n) are both 1
    } else {
        // Recursive case: C(n, m) = C(n-1, m-1) + C(n-1, m)
        int result = Choose(n - 1, m - 1) + Choose(n - 1, m);
        return result;
    }
}

