int Choose(int n, int m) {
    int numComb = 0;
    if ((m == 0) || (n == m))  {
        numComb++;
    } else if ((0 < m) && (m < n)) {
        int call1 = Choose(n - 1, m);
        int call2 = Choose(n - 1, m - 1);
        numComb += call1 + call2;
    }
    return numComb;
}

