int Choose(int n, int k) {
    int en = n;
    int kay = k;

    int top = n;

    while (n != 1) {

        top *= (n - 1);
        n--;
    }

    n = en;

    int kfact = k;

    while (k != 1) {

        kfact *= (k - 1);
        k--;
    }

    k = kay;

    int nmk = n - k;

    int botright = nmk;

    while (nmk != 1) {

        botright *= (nmk - 1);
        nmk--;
    }

    int ans = top / (kfact * botright);

    return ans;

}

