int Choose(int a, int b) 
{
    int C[a+1][b+1];
    int i, j;

    for (i = 0; i <= a; i++) 
    {
        for (j = 0; j <= ((i < b) ? i : b); j++) 
        {
            if (j == 0 || j == i)
                C[i][j] = 1;
            else
                C[i][j] = C[i-1][j-1] + C[i-1][j];
        }
    }

    return C[a][b];
}

