    int factorial_n = 1;
    for (int i = 1; i <= n; i++){
        factorial_n *= i;
    }
    
    /* Calculate m! */
    int factorial_m = 1;
    for (int j = 1; j <= m; j++){
        factorial_m *= j;
    }
    
    /* Calculate (n-m)! */
    int factorial_nm = 1;
    for (int k = 1; k <= (n-m); k++){
        factorial_nm *= k;
    }
    
    /* Calculate n choose m */
    int choose = factorial_n / (factorial_m * factorial_nm);
    
    return choose;
}

