int Choose(int n, int m) {
    // Base cases
    if (m == 0 || m == n) {
        return 1;
    } else if (m == 1) {
        return n;
    } else {
        // Recursive call
        return Choose(n - 1, m - 1) + Choose(n - 1, m);
    }
}

