void ConvertToBinary(int number){
    if (number == 0){
        printf("0");
        return;
    }
    
    int binary[32];
    int i = 0;
    int j = 0;
    
    
    while (number > 0){
        binary[i++] = number % 2;
        number = number / 2;

    }
    
    
    for (j = i - 1; j >= 0; j--){
      printf("%d", binary[j]);
    }
    
    
}

